  return (
<body className="page light-theme">
	<div className="main">
      <Header/>
        <div className="books">
            <section data-testid="404">
              <h1>404.Страница не найдена</h1>
              <Link to={AppRoute.MAIN}>Вернуться на главную</Link>
            </section>
        </div>
    </div>

 </body> 
  );
};


export default NotFoundScreen;
